StringeePhone.formatDuration = function (duration) {
    var time = Math.floor(duration / 1000);

    var second = time % 60;
    var minute = Math.floor(time / 60);
    var hour;
    if (minute < 60) {
        hour = 0;
    } else {
        hour = Math.floor(minute / 60);
        minute = minute % 60;
    }

    //them so 0
    if (hour < 10) {
        hour = '0' + hour;
    }
    if (minute < 10) {
        minute = '0' + minute;
    }
    if (second < 10) {
        second = '0' + second;
    }

    var timeString;
    if (hour === '00') {
        timeString = minute + ':' + second;
    } else {
        timeString = hour + ':' + minute + ':' + second;
    }

    return timeString;
};

